def to_bytes(filename):
    file = open(filename,"rb")
    total = ""
    while True:
        byte = file.read(1)
        if(len(byte) == 0):
            break
        if(len(total) > 0):
            total += ","
        total += str(ord(byte))
    return total

def from_bytes(text,filename):
    total = ""
    bytelist = text.split(",")
    bytelist_processed = [int(x) for x in bytelist]
    file = open(filename,"wb")
    file.write(bytearray(bytelist_processed))

